We have got the problem that the Internet Explorer does not display some images, whereas the firefox can display the same images, see attached file Screenshot.PNG.

These Images are from a different domain and the URL of these images start with "https://".

The issue can be reproduced in the Qooxdoo playground with the following code:

var doc = this.getRoot();

var button1 = new qx.ui.form.Button("First Button", "https://diy-cockpit.1und1.de/static/WambaPage/error_icon.png");
doc.add(button1, { left : 100, top  : 50 });


var button2 = new qx.ui.form.Button("Second Button", "https://webdesk.1und1.de/code-service/reg/file/guilibrary/decoration/oneandone/logo.png");
doc.add(button2, { left : 100, top  : 150 });

var button3 = new qx.ui.form.Button("Third Button", "https://diy-cockpit.1und1.de/resources/de.schlund.ebusiness.cockpit.frontend.CockpitApplication/diy_cockpit.png");
doc.add(button3, { left : 100, top  : 250 });
